	(2, 'Glarus', 'Brewery 359', 27, '4.5', 'A wholly Bulgarian product, produced in the first Bulgarian microbrewery, which bottles beer for the market. It is a Brewery 359 located in the village of Marble in Sofia, which is the water for their production. Unfiltered, light-amber alloy with German malt Weyermann, American varieties of hops produced in Bulgaria and yeast from Belgium. Wild beer is the result of a three-year development and is, as we would like to say, a slightly bulbous version of a blonde ail - a flour, a light beater and a dry finish. Unfiltered, with secondary fermentation in the bottle.', 40, 1, 0, '/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDABALDA4MChAODQ4SERATGCgaGBYWGDEjJR0oOjM9PDkz\nODdASFxOQERXRTc4UG1RV19iZ2hnPk1xeXBkeFxlZ2P/2wBDARESEhgVGC8aGi9jQjhCY2NjY2Nj\nY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2NjY2P/wAARCAJYAlgDASIA\nAhEBAxEB/8QAGwABAAIDAQEAAAAAAAAAAAAAAAMEAQIFBgf/xABKEAACAQMBBQQHBAYIBQQCAwAA\nAQIDBBEhBRIxQVEGE2FxIjKBkaGxwRQjM9EHQlJicvAVJENjgpKy4SVTc6LCFiY1kzTxRFSD/8QA\nGgEBAAMBAQEAAAAAAAAAAAAAAAECAwQFBv/EACsRAQEAAgIBBAICAQMFAAAAAAABAhEDITESE0FR\nBDIiYXEUM0IjgZHh8P/aAAwDAQACEQMRAD8A+gAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\nAAAADU8v2q23dWtxS2fYS7utOO/UqYzux8Pcz1J4btPBQv7i53lmUFS15JtJspndTp0fjYTPP+SC\nhG6rtuttG7nKLxLFWSWemhO7aDSzUrOTzq68n9ShWubm3q0qdKVJVNXNuPoyk29fdhENxf14q2dG\nUVUVLckmtHJyefoc+3qe39RNd06VOCffVU5epu1JZb95yZ/aYyW7cV3He3dKj0fvLN5WrRt6VOco\nudOo0ppacnw8COjvRtqqqTTclGphL1XvY+o3VrjjerG0JzivTuK3TLqS4+8kc6i9S5rLxVSX5lez\nxKolVmnB64ceLenwM2lOdetCjKe7Btt8nos8SO156fpLG/vaUs0724/+xtHrOy3aCrf1nZXj3qqh\nvQqftY4p+J4hy3JJqSeZqKWOvFnS2H9ztaznFpvvUljo9PkWxtlY8/HjnhZruPp4MGTqeIAAAAAA\nAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\nAAAMHmO3NWhbbGbcIOtWqRjHTV4eX8j0x867e3TuNswtU/QoQSx+9LV/DAN34cO1raJzhvebOj9o\npShh20PPLKlGitETyp4RXPHppx5d9sTnSkvwsLpvMhcqf7D/AM7Mz0Kzkcdw1XXMkznD9l/52QVJ\nw/Y97ZiUiGci2OPauWXS3ZXvcTeKNOaf7ayey/R/cU6lpd27jFVYVt/Hg1p8jwVHWS8z0HZa5dl2\njoa4hcp05Lx5fFHZJ04srdvphkwZAAAAAAAAAAAAAAAAAAAAA